webpackJsonp([0x862170c65a90],{589:function(e,a){e.exports={data:{markdownRemark:{html:"<p>Well, the first time I saw her was down in New Orleans<br>\nSteeping a cure-all of honey and Jimson weed<br>\nSewed a mojo hand in the seam of my jean<br>\nDid a little dance like a voodoo queen  </p>\n<p><em>Oh Black Rose</em><br>\n<em>Never near, but always close</em><br>\n<em>Face to face when the moonlight glows</em><br>\n<em>Feel the dawn, as her silhouette goes</em><br>\n<em>Oh Black Rose</em>  </p>\n<p>Saw her gathering feathers outside of Stovepipe Wells<br>\nWearing some leather plated with terrapin shells<br>\nPricked my hand pulled me under her spell<br>\nIn the cool of the sand where the spirits yell  </p>\n<p><em>Oh Black Rose</em><br>\n<em>Never near, but always close</em><br>\n<em>Face to face when the moonlight glows</em><br>\n<em>Feel the dawn, as her silhouette goes</em><br>\n<em>Oh Black Rose</em>  </p>\n<p>The last time I saw her was in the Lake Eerie fog<br>\nEyes in the water I thought she was just a mirage<br>\nSitting low in the wake of the bog<br>\nEmerging slow floating like a god  </p>\n<p><em>Oh Black Rose</em><br>\n<em>Never near, but always close</em><br>\n<em>Face to face when the moonlight glows</em><br>\n<em>Feel the dawn, as her silhouette goes</em><br>\n<em>Oh Black Rose</em>  </p>",frontmatter:{title:"Black Rose"},fields:{date:null}}},pathContext:{slug:"/songs/black-rose/"}}}});
